import React from 'react';
import './style.scss';
import { Link } from 'react-router-dom';
import tasksy from './../../images/img-tasksy.png';
import github from './../../images/ic-navbar-github.svg';

import { Icon } from 'react-icons-kit';
import { arrows_slim_right } from 'react-icons-kit/linea/arrows_slim_right';

//Icons

import react from './../../images/react.svg';
import mongodb from './../../images/mongodb.svg';
import express from './../../images/expressjs-icon.svg';
import node from './../../images/nodejs-icon.svg';
import sass from './../../images/sass-1.svg';

function Wasabi() {
  return (
    <div className="project">
      <div className="project-content">
        <h1>Don't Feed Wasabi</h1>
        <p>
          2D game developed in Javascript. It was developed as a tribute to the most wonderful cat
          on earth. Avoid the salmons, so it doesn't get too fat, get all the hearts to win the
          game.
        </p>
        <div className="content-btn">
          <Link to="https://github.com/myriankatto/ironhack-project3" target="_blank">
            <div className="github-btn">
              <img src={github} alt="github" /> <span>Github</span>
            </div>
          </Link>
          <Link to="https://github.com/myriankatto/project-1" target="_blank">
            <div className="project-btn">
              <span>See Project</span>
              <Icon icon={arrows_slim_right} size={35} />
            </div>
          </Link>
        </div>
        <div className="content-icons">
          <span>Developed with</span>
          <div className="icons">
            <img src={react} style={{ width: '1.2em' }} alt="react.js" />
            <img src={node} style={{ width: '1em' }} alt="node.js" />
            <img src={mongodb} style={{ width: '3.8em' }} alt="mongodb" />
            <img src={express} style={{ width: '1.2em' }} alt="express.js" />
            <img src={sass} style={{ width: '1.2em' }} alt="sass" />
          </div>
        </div>
      </div>
      <div className="project-image">
        <img src={tasksy} alt="Myrian Katto" />
      </div>
    </div>
  );
}

export default Wasabi;
